INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES
(1, 'node', ' تور دروپال گردی در پاییز لورم ایپسوم یا طرح نما به متنی آزمایشی و بی معنی در صنعت چاپ صفحه آرایی و طراحی گرافیک گفته می شود طراح گرافیک از این متن به عنوان عنصری از ترکیب بندی برای پر کردن صفحه و ارایه اولیه شکل ظاهری و کلی طرح سفارش گرفته شده استفاده می نماید تا از نظر گرافیکی نشانگر چگونگی نوع و اندازه فونت و ظاهر متن باشد معمولا طراحان گرافیک برای صفحه آرایی نخست از متن های آزمایشی و بی معنی استفاده می کنند تا صرفا به مشتری یا صاحب کار خود نشان دهند که صفحه طراحی یا صفحه بندی شده بعد از اینکه متن در آن قرار گیرد چگونه به نظر می رسد و قلم ها و اندازه بندی ها چگونه در نظر گرفته شده است از آنجایی که طراحان عموما نویسنده متن نیستند و وظیفه رعایت حق تکثیر متون را ندارند و در همان حال کار آنها به نوعی وابسته به متن می باشد آنها با استفاده از محتویات ساختگی صفحه گرافیکی خود را صفحه آرایی می کنند تا مرحله طراحی و صفحه بندی را به پایان برند 50000تومان یک شنبه ژانویه 22 2017 to پنج شنبه ژانویه 26 2017 توریستی جزو تورهای ویژه می باشد  ', 0),
(2, 'node', ' دروپال در کاخ سفید لورم ایپسوم یا طرح نما به متنی آزمایشی و بی معنی در صنعت چاپ صفحه آرایی و طراحی گرافیک گفته می شود طراح گرافیک از این متن به عنوان عنصری از ترکیب بندی برای پر کردن صفحه و ارایه اولیه شکل ظاهری و کلی طرح سفارش گرفته شده استفاده می نماید تا از نظر گرافیکی نشانگر چگونگی نوع و اندازه فونت و ظاهر متن باشد 20000تومان یک شنبه ژانویه 22 2017 خارجی جزو تورهای ویژه می باشد  ', 0),
(3, 'node', ' تور 5 روزه آموزش دروپال لورم ایپسوم یا طرح نما به متنی آزمایشی و بی معنی در صنعت چاپ صفحه آرایی و طراحی گرافیک گفته می شود طراح گرافیک از این متن به عنوان عنصری از ترکیب بندی برای پر کردن صفحه و ارایه اولیه شکل ظاهری و کلی طرح سفارش گرفته شده استفاده می نماید تا از نظر گرافیکی نشانگر چگونگی نوع و اندازه فونت و ظاهر متن باشد معمولا طراحان گرافیک برای صفحه آرایی نخست از متن های آزمایشی و بی معنی استفاده می کنند تا صرفا به مشتری یا صاحب کار خود نشان دهند که صفحه طراحی یا صفحه بندی شده بعد از اینکه متن در آن قرار گیرد چگونه به نظر می رسد و قلم ها و اندازه بندی ها چگونه در نظر گرفته شده است از آنجایی که طراحان عموما نویسنده متن نیستند و وظیفه رعایت حق تکثیر متون را ندارند و در همان حال کار آنها به نوعی وابسته به متن می باشد آنها با استفاده از محتویات ساختگی صفحه گرافیکی خود را صفحه آرایی می کنند تا مرحله طراحی و صفحه بندی را به پایان برند 100000تومان یک شنبه ژانویه 22 2017 گردشگری جزو تورهای ویژه می باشد  ', 0),
(4, 'node', ' سواحل زیبای خلیج فارس لورم ایپسوم یا طرح نما به متنی آزمایشی و بی معنی در صنعت چاپ صفحه آرایی و طراحی گرافیک گفته می شود  ', 0),
(5, 'node', ' آرامش در کویر مرنجاب لورم ایپسوم یا طرح نما به متنی آزمایشی و بی معنی در صنعت چاپ صفحه آرایی و طراحی گرافیک گفته می شود  ', 0),
(6, 'node', ' دروپال در کویر لورم ایپسوم یا طرح نما به متنی آزمایشی و بی معنی در صنعت چاپ صفحه آرایی و طراحی گرافیک گفته می شود طراح گرافیک از این متن به عنوان عنصری از ترکیب بندی برای پر کردن صفحه و ارایه اولیه شکل ظاهری و کلی طرح سفارش گرفته شده استفاده می نماید تا از نظر گرافیکی نشانگر چگونگی نوع و اندازه فونت و ظاهر متن باشد معمولا طراحان گرافیک برای صفحه آرایی نخست از متن های آزمایشی و بی معنی استفاده می کنند تا صرفا به مشتری یا صاحب کار خود نشان دهند که صفحه طراحی یا صفحه بندی شده بعد از اینکه متن در آن قرار گیرد چگونه به نظر می رسد و قلم ها و اندازه بندی ها چگونه در نظر گرفته شده است از آنجایی که طراحان عموما نویسنده متن نیستند و وظیفه رعایت حق تکثیر متون را ندارند و در همان حال کار آنها به نوعی وابسته به متن می باشد آنها با استفاده از محتویات ساختگی صفحه گرافیکی خود را صفحه آرایی می کنند تا مرحله طراحی و صفحه بندی را به پایان برند 400000تومان دوشنبه ژانویه 23 2017 گردشگری ', 0),
(7, 'node', ' ماژول های مورد نیاز در دروپال لورم ایپسوم یا طرح نما به متنی آزمایشی و بی معنی در صنعت چاپ صفحه آرایی و طراحی گرافیک گفته می شود طراح گرافیک از این متن به عنوان عنصری از ترکیب بندی برای پر کردن صفحه و ارایه اولیه شکل ظاهری و کلی طرح سفارش گرفته شده استفاده می نماید تا از نظر گرافیکی نشانگر چگونگی نوع و اندازه فونت و ظاهر متن باشد معمولا طراحان گرافیک برای صفحه آرایی نخست از متن های آزمایشی و بی معنی استفاده می کنند تا صرفا به مشتری یا صاحب کار خود نشان دهند که صفحه طراحی یا صفحه بندی شده بعد از اینکه متن در آن قرار گیرد چگونه به نظر می رسد و قلم ها و اندازه بندی ها چگونه در نظر گرفته شده است از آنجایی که طراحان عموما نویسنده متن نیستند و وظیفه رعایت حق تکثیر متون را ندارند و در همان حال کار آنها به نوعی وابسته به متن می باشد آنها با استفاده از محتویات ساختگی صفحه گرافیکی خود را صفحه آرایی می کنند تا مرحله طراحی و صفحه بندی را به پایان برند نوع آموزش توریستی کلمات کلیدی قالب دروپال  ', 0),
